import React from "react";
import "./style.css";

function Jumbotron() {
    return (
        <div className="jumbotron text-center">
            <h1>Google Books Api App</h1>
            <h3>Search for books and Save them for later </h3>
        </div>
    );
}

export default Jumbotron;
